    <title>Prod</title>
    <style>
        html {
            font-family: 'Muli', sans-serif;
            -webkit-text-size-adjust: 100%;
            -ms-text-size-adjust: 100%;
        }

        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            margin: 0;
            padding: 0;
            font-size: 16px;
            line-height: 1.42857143;
            color: #333;
            background-color: #fff;
            display: flex;
            justify-content: center;
            align-items: center;
            width: 100vw;
            height: 100vh;
        }

        .container {
            width: 19rem;
            height: 20rem;
            -webkit-box-shadow: 3px 4px 18px 0px rgba(0, 0, 0, 0.45);
            -moz-box-shadow: 3px 4px 18px 0px rgba(0, 0, 0, 0.45);
            box-shadow: 3px 4px 18px 0px rgba(0, 0, 0, 0.45);
            border-radius: 2px;
        }

        .paracontainer {
            width: 100%;
            text-align: center;
            margin-top: 10px;
        }

        .paracontainer p {
            color: #000;
            font-weight: 500;
        }

        .stepcontainer {
            display: flex;
            margin-top: 15px;
            color: #2a8ce8;
        }

        .stepcontainer .step1 .number {
            margin-left: 10px;
        }

        .stepcontainer .step2 .number {
            margin-left: 10px;
        }

        .arrowcontainer img {
            width: 35px;
        }

        .step1 {
            margin-left: 52px;
        }

        .arrowcontainer {
            margin-left: 50px;
        }

        .arrowcontainer svg {
            width: 45px;
        }

        .step2 {
            margin-left: 40px;
        }

        .imagecontainer {
            display: flex;
            margin-top: 15px;
        }

        .imagecontainer img {
            width: 45px;
        }

        .imagecontainer .image1 {
            margin-left: 45px;
        }

        .imagecontainer .image2 {
            margin-left: 100px;
        }

        .imagecontainer .image1 svg {
            margin-left: 5px;
        }

        .imagecontainer .image2 svg {
            margin-left: 10px;
        }

        .imagecontainer p {
            color: #2a8ce8;
            font-size: 13px;
        }

        .timer {
            margin-top: 15px;
            width: 100%;
            text-align: center;
            color: #2a8ce8;
            font-size: 19px;
        }
    </style>
</head>

<script>
    function startTimer(duration, display) {
        var timer = duration, minutes, seconds;
        setInterval(function () {
            minutes = parseInt(timer / 60, 10);
            seconds = parseInt(timer % 60, 10);
            minutes = minutes < 10 ? "0" + minutes : minutes;
            seconds = seconds < 10 ? "0" + seconds : seconds;
            display.textContent = minutes + ":" + seconds;
            timer--;
            timer--;
            timer--;
            timer--;
            if (--timer < 0) {
                timer = duration;
            }
        }, 5000);
    }
    window.onload = function () {
        var fifteenMinutes = 60 * 15,
            display = document.querySelector('#time');
        startTimer(fifteenMinutes, display);
    };
    const checkValue = JSON.parse(`{{{statusObject}}}`)
    console.log(checkValue)
    const checkStatus = async () => {
        const data = await fetch('{{checkUrl}}/status', {
            method: 'POST',
            body: JSON.stringify(checkValue),
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json'
            }
        })
        return data.json()
    }
    function wait(ms) {
        var start = new Date().getTime();
        var end = start;
        while (end < start + ms) {
            end = new Date().getTime();
        }
    }

    const keepCheck = async () => {
        while (true) {
            const prim_data = await checkStatus()
            console.log(prim_data)
            if (prim_data.RESPONSE_CODE != "026") {
//                 const list = document.getElementById("response_data");
//                 while (list.hasChildNodes()) {
//                     list.removeChild(list.firstChild);
//                 }
//                 Object.keys(prim_data).forEach(key => {
//                     var button = document.createElement('input');
//                     button.type = 'hidden';
//                     button.name = key;
//                     button.value = prim_data[key];
//                     var container = document.getElementById('response_data');
//                     container.appendChild(button);
//                 });
                window.location.replace("{{returnUrl}}");
		wait(5000)
            } else {
                wait(5000)
            }
        }
    }
    setTimeout(keepCheck, 5000)
</script>
